// File: contracts/Twit2Mars.sol



pragma solidity ^0.8.4;




contract StonersTownWtf is ERC721A, Ownable, ReentrancyGuard {
    using Strings for uint256;

    uint256 public budPrice;
    uint256 public maxbuds;
    string private weedStore;
    uint256 public freeBudPerWallet;
    uint256 public maxBudPerTrans;
    bool public IS_SALE_ACTIVE;
    uint256 public freeBudAllowedUntil;
    bool public METADATA_FROZEN;

    mapping(address => uint256) private freeMintCountMap;

    constructor(
        uint256 price,
        uint256 maxSupply,
        string memory baseUri,
        uint256 freeMintAllowance,
        uint256 maxMintPerTx,
        bool isSaleActive,
        uint256 freeMintIsAllowedUntil
    ) ERC721A("StonersTownWtf", "STW") {
        budPrice = price;
        maxbuds = maxSupply;
        weedStore = baseUri;
        freeBudPerWallet = freeMintAllowance;
        maxBudPerTrans = maxMintPerTx;
        IS_SALE_ACTIVE = isSaleActive;
        freeBudAllowedUntil = freeMintIsAllowedUntil;
    }

    /** FREE MINT **/

    function updateFreeMintCount(address minter, uint256 count) private {
        freeMintCountMap[minter] += count;
    }

    /** GETTERS **/

    function _baseURI() internal view virtual override returns (string memory) {
        return weedStore;
    }

    /** SETTERS **/

    function setPrice(uint256 customPrice) external onlyOwner {
        budPrice = customPrice;
    }

    function lowerMaxSupply(uint256 newMaxSupply) external onlyOwner {
        require(newMaxSupply < maxbuds, "Invalid new max supply");
        require(newMaxSupply >= _currentIndex, "Invalid new max supply");
        maxbuds = newMaxSupply;
    }

    function setBaseURI(string memory customBaseURI_) external onlyOwner {
        require(!METADATA_FROZEN, "Metadata frozen!");
        weedStore = customBaseURI_;
    }

    function setFreeMintAllowance(uint256 freeMintAllowance)
        external
        onlyOwner
    {
        freeBudPerWallet = freeMintAllowance;
    }

    function setMaxMintPerTx(uint256 maxMintPerTx) external onlyOwner {
        maxBudPerTrans = maxMintPerTx;
    }

    function setSaleActive(bool saleIsActive) external onlyOwner {
        IS_SALE_ACTIVE = saleIsActive;
    }

    function setFreeMintAllowedUntil(uint256 freeMintIsAllowedUntil)
        external
        onlyOwner
    {
        freeBudAllowedUntil = freeMintIsAllowedUntil;
    }

    function freezeMetadata() external onlyOwner {
        METADATA_FROZEN = true;
    }

    /** MINT **/

    modifier mintCompliance(uint256 _mintAmount) {
        require(
            _mintAmount > 0 && _mintAmount <= maxBudPerTrans,
            "Invalid mint amount!"
        );
        require(
            _currentIndex + _mintAmount <= maxbuds,
            "Max supply exceeded!"
        );
        _;
    }

    function mint(uint256 _mintAmount)
        public
        payable
        mintCompliance(_mintAmount)
    {
        require(IS_SALE_ACTIVE, "Sale is not active!");

        uint256 price = budPrice * _mintAmount;

        if (_currentIndex < freeBudAllowedUntil) {
            uint256 remainingFreeMint = freeBudPerWallet -
                freeMintCountMap[msg.sender];
            if (remainingFreeMint > 0) {
                if (_mintAmount >= remainingFreeMint) {
                    price -= remainingFreeMint * budPrice;
                    updateFreeMintCount(msg.sender, remainingFreeMint);
                } else {
                    price -= _mintAmount * budPrice;
                    updateFreeMintCount(msg.sender, _mintAmount);
                }
            }
        }

        require(msg.value >= price, "Insufficient funds!");

        _safeMint(msg.sender, _mintAmount);
    }

    function mintOwner(address _to, uint256 _mintAmount)
        public
        mintCompliance(_mintAmount)
        onlyOwner
    {
        _safeMint(_to, _mintAmount);
    }

    /** PAYOUT **/

    address private constant payoutAddress1 =
        0x2e45A3053639CE97f43b4761CA9332Ea7B5aDB8a;


    function withdraw() public onlyOwner nonReentrant {
        uint256 balance = address(this).balance;
        Address.sendValue(payable(payoutAddress1), balance);
    }
}

